/* Import statements */
import React, { Component } from "react";
import { Link, Route, Switch } from "react-router-dom";

/* Componente Pagina Inicial */
const main = () => (
  <div>
    <h2>Home</h2>
  </div>
);

/* Componente Categoria */
const postagens= () => (
  <div>
    <h2>Postagens</h2>
  </div>
);

/* Componente de Artigos */
const albuns = () => (
  <div>
    <h2>Álbuns</h2>
  </div>
);

/* Componente de Artigos */
const todos = () => (
  <div>
    <h2>TO-DOs</h2>
  </div>
);

export default function App() {
  return (
    <div>
      <nav className="navbar navbar-light">
        <ul className="nav navbar-nav">
          <li>
            <Link to="/">Pagina inicial</Link>
          </li>
          <li>
            <Link to="/categoria">Categoria</Link>
          </li>
          <li>
            <Link to="/artigos">React Router</Link>
          </li>
        </ul>
      </nav>
      /* Os componentes da rota são renderizados se o caminho prop corresponder ao URL atual */
      <Route path="/" component={main} />
      <Route path="/categoria" component={postagens} />
      <Route path="/artigos" component={albuns} />
    </div>
  );
}
